"font-family: monospace; margin: 0;\"&gt;distributed.scheduler - INFO - Register worker &amp;lt;WorkerState &amp;#x27;tcp://10.32.2.19:40551&amp;#x27;, name: SLURMCluster-0, memory: 0, processing: 0&amp;gt;&lt;/p&gt;\n    \n\n    \n        &lt;p style=\"font-family: monospace; margin: 0;\"&gt;distributed.scheduler - INFO - Starting worker compute stream, tcp://10.32.2.19:40551&lt;/p&gt;\n    \n"},"id":"5822","type":"Div"},{"attributes":{"dimensions":"width"},"id":"5723","type":"PanTool"},{"attributes":{"child":{"id":"5425"},"title":"Worker Profile (compute)"},"id":"5825","type":"Panel"},{"attributes":{"axis":{"id":"5714"},"coordinates":null,"group":null,"ticker":null},"id":"5717","type":"Grid"},{"attributes":{"child":{"id":"5823"},"title":"Summary"},"id":"5824","type":"Panel"},{"attributes":{"child":{"id":"5497"},"title":"Worker Profile (administrative)"},"id":"5826","type":"Panel"},{"attributes":{},"id":"5857","type":"BasicTickFormatter"},{"attributes":{"style":{"border":"1px solid lightgray","box-shadow":"inset 1px 0 8px 0 lightgray","height":"100%","max-height":"1080px","max-width":"1920px","overflow":"auto","padding":"12px","width":"100%"},"text":"\n        &lt;h1&gt; Dask Performance Report &lt;/h1&gt;\n\n        &lt;i&gt; Select different tabs on the top for additional information &lt;/i&gt;\n\n        &lt;h2&gt; Duration: 40.04 s &lt;/h2&gt;\n        &lt;h2&gt; Tasks Information &lt;/h2&gt;\n        &lt;ul&gt;\n         &lt;li&gt; number of tasks: 3 &lt;/li&gt;\n         \n&lt;li&gt; compute time: 39.94 s &lt;/li&gt;\n        &lt;/ul&gt;\n\n        &lt;h2&gt; Scheduler Information &lt;/h2&gt;\n        &lt;ul&gt;\n          &lt;li&gt; Address: tcp://188.185.68.194:35350 &lt;/li&gt;\n          &lt;li&gt; Workers: 1 &lt;/li&gt;\n          &lt;li&gt; Threads: 1 &lt;/li&gt;\n          &lt;li&gt; Memory: 14.90 GiB &lt;/li&gt;\n          &lt;li&gt; Dask Version: 2021.09.1 &lt;/li&gt;\n          &lt;li&gt; Dask.Distributed Version: 2021.09.1 &lt;/li&gt;\n        &lt;/ul&gt;\n\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\nfrom dask_jobqueue import SLURMCluster\nfrom distributed import Client\nfrom dask import delayed\n\nfrom dask.distributed import performance_report\n\nimport logging\nlogging.basicConfig(format='%(levelname)s:%(message)s', level=logging.DEBUG)\n\nimport argparse\nparser = argparse.ArgumentParser()\nparser.add_argument(\"-c\", \"--cores\", type=int, default=4)\nparser.add_argument(\"-N\", \"--Nodes\", type=int, default=1)\nparser.add_argument(\"-f\", \"--files\", type=int, default=100)\nparser.add_argument(\"-p\", \"--pts\", type=int, default=400)\nargs = parser.parse_args()\n\n#import pdb; pdb.set_trace()\n\ncluster = SLURMCluster(memory='{}g'.format(16*args.cores),\n                       processes=args.cores,\n                       cores=args.cores,\n                       queue='photon',\n                       #python='python',\n                       local_directory='/tmp/ikabadzh',\n                       header_skip=['-n 1', '-t 00:30:00'],\n                       job_extra=['--ntasks-per-node=1', '-t 8:00:00'])\n\n#import pdb; pdb.set_trace()\ncluster.scale(jobs=args.Nodes)\n#print(cluster.get_logs())\nclient = Client(cluster)\n\n\nimport ROOT\nROOT.gROOT.SetBatch(True)\n\nRDataFrame = ROOT.RDF.Experimental.Distributed.Dask.RDataFrame\n\n\n\ndef dimuonSpectrum(df):\n    # Select events with exactly two muons\n    df_2mu = df.Filter(\"nMuon == 2\", \"Events with exactly two muons\")\n\n    # Select events with two muons of opposite charge\n    df_os = df_2mu.Filter(\n        \"Muon_charge[0] != Muon_charge[1]\", \"Muons with opposite charge\")\n\n    # Compute invariant mass of the dimuon system\n    df_mass = df_os.Define(\n        \"Dimuon_mass\",\n        \"ROOT::VecOps::InvariantMass(Muon_pt, Muon_eta, Muon_phi, Muon_mass)\")\n\n    # Book histogram of dimuon mass spectrum\n    bins = 30000  # Number of bins in the histogram\n    low = 0.25  # Lower edge of the histogram\n    up = 300.0  # Upper edge of the histogram\n\n    hist = df_mass.Histo1D(ROOT.RDF.TH1DModel(\n        \"\", \"\", bins, low, up), \"Dimuon_mass\")\n\n    # Create canvas for plotting\n    ROOT.gStyle.SetOptStat(0)\n    ROOT.gStyle.SetTextFont(42)\n    c = ROOT.TCanvas(\"c\", \"\", 800, 700)\n    c.SetLogx()\n    c.SetLogy()\n\n    client.wait_for_workers(args.Nodes)\n    watch = ROOT.TStopwatch()\n    hist.GetValue() # triggers the event loop\n    elapsed = watch.RealTime()\n    file_out = open('../../distrdf_timestamps.out', 'a')\n    file_out.write(\"\\ncores={} Nodes={}: Event Loop={}s\\n\".format(args.cores, args.Nodes, elapsed))\n    file_out.close()\n\n    # Draw histogram\n    hist.GetXaxis().SetTitle(\"m_{#mu#mu} (GeV)\")\n    hist.GetXaxis().SetTitleSize(0.04)\n    hist.GetYaxis().SetTitle(\"N_{Events}\")\n    hist.GetYaxis().SetTitleSize(0.04)\n    hist.SetStats(False)\n    hist.Draw()\n\n    # Draw labels\n    label = ROOT.TLatex()\n    label.SetTextAlign(22)\n    label.DrawLatex(0.55, 3.0e4, \"#eta\")\n    label.DrawLatex(0.77, 7.0e4, \"#rho,#omega\")\n    label.DrawLatex(1.20, 4.0e4, \"#phi\")\n    label.DrawLatex(4.40, 1.0e5, \"J/#psi\")\n    label.DrawLatex(4.60, 1.0e4, \"#psi'\")\n    label.DrawLatex(12.0, 2.0e4, \"Y(1,2,3S)\")\n    label.DrawLatex(91.0, 1.5e4, \"Z\")\n    label.SetNDC(True)\n    label.SetTextAlign(11)\n    label.SetTextSize(0.04)\n    label.DrawLatex(0.10, 0.92, \"#bf{CMS Open Data}\")\n    label.SetTextAlign(31)\n    label.DrawLatex(0.90, 0.92, \"#sqrt{s} = 8 TeV, L_{int} = 11.6 fb^{-1}\")\n\n    # Save Canvas to image\n    c.SaveAs(\"dimuonSpectrum.png\")\n\nif __name__ == '__main__':\n    #filelist = [\"/hpcscratch/user/ikabadzh/works/BENCH2/input_files/dimuon/f{}.root\".format(i) for i in range(1,1001)]\n    filelist = [\"input_files/dimuon/f{}.root\".format(i) for i in range(1, args.files+1)]\n    df = RDataFrame(\"Events\", filelist, npartitions=(args.pts), daskclient=client)\n    \n    for i in range(3):\n      with performance_report(filename=\"dask-report_{}.html\".format(i)):\n        dimuonSpectrum(df)\n\n\n        &lt;/pre&gt;\n        "},"id":"5823","type":"Div"},{"attributes":{},"id":"5858","type":"AllLabels"},{"attributes":{"child":{"id":"5461"},"title":"Scheduler Profile (administrative)"},"id":"5827","type":"Panel"},{"attributes":{"axis":{"id":"5718"},"coordinates":null,"dimension":1,"group":null,"ticker":null},"id":"5721","type":"Grid"},{"attributes":{},"id":"5860","type":"BasicTickFormatter"},{"attributes":{"line_color":"#1f77b4","x":{"field":"time"},"y":{"field":"memory"}},"id":"5697","type":"Line"},{"attributes":{},"id":"5851","type":"BasicTickFormatter"},{"attributes":{"child":{"id":"bk-task-stream-plot"},"title":"Task Stream"},"id":"5828","type":"Panel"},{"attributes":{"child":{"id":"bk-bandwidth-worker-plot"},"title":"Bandwidth (Workers)"},"id":"5829","type":"Panel"},{"attributes":{},"id":"5861","type":"AllLabels"},{"attributes":{},"id":"5722","type":"ResetTool"},{"attributes":{"num_minor_ticks":5,"tickers":[{"id":"5744"},{"id":"5745"},{"id":"5746"},{"id":"5747"},{"id":"5748"},{"id":"5749"},{"id":"5750"},{"id":"5751"},{"id":"5752"},{"id":"5753"},{"id":"5754"},{"id":"5755"}]},"id":"5715","type":"DatetimeTicker"},{"attributes":{"coordinates":null,"group":null,"text":"Bandwidth"},"id":"5705","type":"Title"},{"attributes":{},"id":"5710","type":"LinearScale"},{"attributes":{"axis_label":"Bytes","coordinates":null,"formatter":{"id":"5788"},"group":null,"major_label_policy":{"id":"5904"},"ticker":{"id":"5686"}},"id":"5685","type":"LinearAxis"},{"attributes":{"line_alpha":0.2,"line_color":"#1f77b4","x":{"field":"time"},"y":{"field":"cpu"}},"id":"5666","type":"Line"},{"attributes":{"coordinates":null,"formatter":{"id":"5740"},"group":null,"major_label_policy":{"id":"5741"},"ticker":{"id":"5715"}},"id":"5714","type":"DatetimeAxis"},{"attributes":{},"id":"5876","type":"CategoricalTickFormatter"},{"attributes":{},"id":"5855","type":"AllLabels"},{"attributes":{},"id":"5877","type":"All
